    "2015-02-04T19:17:40.052083",nt"name": "maryland-ozone-exceedance-days-in-2006-78c81",nt"isopen":
    false,nt"url": null,nt"notes": "Maryland 8-Hour Ozone Concentrations Exceeding
    2008 Health-Based Standard in ppb, Finalized Data.  In 2008 EPA set the ozone standard
    to 75 ppb.  High levels of ozone can cause health effects including increased asthma
    attacks and other respiratory effects.  You can get more information about the health
    effects at http://www.epa.gov/air/ozonepollution/.  This data set details which
    monitoring locations in Maryland exceeded the standard during the year and the maximum
    concentrations on the dates the standard was exceeded.  More information on Maryland's
    air quality monitoring is available at http://www.mde.state.md.us/programs/Air/AirQualityMonitoring/Pages/index.aspx.",nt"license_title":
